            ret.PotentialGrass = item.PotentialGrass.CollectionEqualsHelper(
                rhs.PotentialGrass,
                (l, r) => object.Equals(l, r),
                include);
            MajorRecordCommon.FillEqualsMask(item, rhs, ret);
